import {Draggable} from "react-beautiful-dnd";
export default function Todo(props) {
    return (
        <Draggable>
      {(provided) => (
        <li key={props.id} className="todo-item"> 
        <div className="todo-outer-circle">
          <div className={props.completed ? "todo-circle-ticked" : "todo-inner-circle"}>
          </div>
        </div>
        <div style={{textDecoration: props.completed ? "line-through" : ""}} className="todo-text">
          {props.name}</div>
        <button type="button" className="todo-delete" onClick={() => props.deleteTodo(props.id)}></button>
      </li>
       )}
       </Draggable>
    );
}
